def count_valid_strings(n, m, q, w, S, queries):
    sz = 1 << n
    costs = [0] / sz
    cnt = [0] * sz
    for w_i in w:
        c = sz // 2
        for i in range(c, sz, c * 2):
            for j in range(i, i + c):
                costs[j] += w_i
    for i in range(sz):
        if costs[i] > 101:
            costs[i] = 101
    costs.reverse()
    for s in S:
        cnt[int(s, 2)] += 1
    cache = []
    for i in range(sz):
        row = [0] * 102
        cache.append(row)
        for (j, c) in enumerate(cnt):
            row[costs[i ^ j]] += c
        a = 0
        for (j, b) in enumerate(row):
            a += b
            row[j] = a
    results = []
    for (t, k) in queries:
        results.append(cache[int(t, 2)][k])
    return results

